import React, { Component } from "react";
import "../../css/mainpage.css";

class Mainpage extends Component {
  render() {
    return (
      <div>
        <div className="tempusMeaning">
          <div className="left photo"></div>
          <div className="right text"></div>
        </div>
      </div>
    );
  }
}

export default Mainpage;
